{
    "$id": "https://api.squarehealth.com/users-bulk/v1/schema/json",
    "$schema": "https://json-schema.org/draft/2020-12/schema",
    "title": "Bulk User Upsert",
    "description": "Description of the schema.",
    "type": "string",
    "properties": {
        "id": {
            "type": "string",
            "description": "Identifier of the user"
        },
        "firstName": {
            "type": "string",
            "description": "First name of the user"
        },
        "lastName": {
            "type": "string",
            "description": "Last name of the user"
        },
        "mobileNumber": {
            "type": "string",
            "description": "Mobile Number of the user"
        },
        "dateOfBirth": {
            "type": "string",
            "description": "Date Of Birth of the user"
        },
        "gender": {
            "type": "string",
            "description": "Gender of the user"
        },
        "sexAtBirth": {
            "type": "string",
            "description": "Sex At Birth of the user"
        },
        "externalUserId": {
            "type": "string",
            "description": "Unique identifier"
        },
        "emailAddress": {
            "type": "string",
            "description": "Email Address of the user"
        },
        "address": {
            "type": "object",
            "addressLine1": {
                "type": "string",
                "description": "Address Line 1 of the user"
            },
            "addressLine2": {
                "type": "string",
                "description": "Address Line 2 of the user"
            },
            "city": {
                "type": "string",
                "description": "City of the user"
            },
            "postalCode": {
                "type": "string",
                "description": "Postal Code of the user"
            },
            "county": {
                "type": "string",
                "description": "County of the user"
            },
            "country": {
                "type": "string",
                "description": "Country of the user"
            }
        },
        "policyDetails": {
            "type": "object",
            "policyNumber": {
                "type": "string",
                "description": "Policy Number"
            },
            "policyId": {
                "type": "string",
                "description": "Billing scheme id"
            },
            "policyStartDate": {
                "type": "string",
                "description": "policy Start Date"
            },
            "policyActive": {
                "type": "boolean",
                "description": "true/false"
            }
        }
    },
    "required": [
        "title",
        "firstName",
        "lastName",
        "mobileNumber",
        "dateOfBirth",
        "gender",
        "sexAtBirth",
        "externalUserId",
        "emailAddress",
        "addressLine1",
        "postalCode",
        "policyNumber",
        "policyId",
        "policyStartDate"
    ]
}

